笹、ヨモギ等数種類の植物から抽出された天然消臭成分バイオデオG配合のゲル状消臭剤。　<br>
あらゆる悪臭を中和・吸収して、車内をさわやかにします。<br>
カートリッジ式で中身の交換ができ、大変お得です。<br><br>

【内容量】 120g <br>
<br>
【香り】<br>
無香　ゲル状<br>
レモンの香り　ゲル状 <br>
<br>
<br>
